import React from 'react';
import { useNavigate } from 'react-router-dom';
// Ensure Tailwind CSS is correctly imported in your project setup
import Navbar from "../navbar/Navbar.jsx";
import backgroundImage from './background.jpeg';


function Login() {
    // Prevent form submission for demonstration purposes
    const handleLogin = (event) => {
      event.preventDefault();
      // Here you would typically handle the login logic
    };

    return (
        <div className="flex min-h-screen">
          {/* Login box container */}
          <div className="flex flex-1 items-center justify-center p-12">
            <div className="max-w-md w-full space-y-8">
              <h2 className="mt-6 text-center text-3xl font-extrabold text-gray-900">
                Welcome.
              </h2>
              {/* Form content */}
            </div>
          </div>
    
          {/* Background image container */}
          <div className="flex-1 hidden lg:block" style={{ backgroundImage: `url(${backgroundImage})`, backgroundSize: 'cover', backgroundPosition: 'center center' }}>
            {/* Empty div to hold background image */}
          </div>
        </div>
      );
    };

export default Login;
